INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "青空の下で謁見", 20063115, 2834, "ペコリーヌとの出会い", 40, 8, 91002, 7, 5118061, "フリーマーケット会場", 0, 1, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "未来の騎空団\nマスコット？", 20063115, 2835, "マホとの出会い", 40, 8, 91002, 7, 5118062, "フリーマーケット会場", 0, 1, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "お嬢さまからの\n緊急依頼", 20063115, 2837, "アキノとの出会い", 40, 8, 91002, 7, 5118063, "ランドソル市街地", 0, 1, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "黄金色の悩みごと", 20063115, 4108402, "ジュンとの出会い", 40, 8, 91002, 18, 5118064, "フリーマーケット会場", 0, 1, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "白熱！　格闘大会！", 20063115, 4107402, "カオリとの出会い", 40, 8, 91002, 18, 5118065, "フリーマーケット会場", 0, 1, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "祭り太鼓はオーエドの華", 20063115, 9000227, "ニノンとの出会い", 40, 8, 91002, 16, 5118066, "オーエド町", 1, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 2);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "人気者は遅れて\nやってくる", 20063115, 2101181, "スズナとの出会い", 40, 8, 91002, 19, 5118067, "フリーマーケット会場", 0, 1, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "巫女・ミーツ・魔法少女", 20063115, 4109402, "ナナカとの出会い", 40, 8, 91002, 18, 5118068, "ランドソル市街地", 0, 1, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "ネズ耳は二度なくなる", 20063115, 4305402, "キャル＆コッコロとの出会い", 40, 8, 91002, 18, 5118069, "フリーマーケット会場", 0, 1, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "この出会いにカンパイ！", 20063115, 4101402, "ユカリとの出会い", 40, 8, 91002, 18, 5118070, "ランドソル市街地", 0, 1, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "陰陽アンサンブル", 20063115, 4106402, "アオイとの出会い", 40, 8, 91002, 18, 5118071, "ランドソル市街地", 0, 1, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "運試し十番勝負！", 20063115, 2836, "シノブとの出会い", 40, 8, 91002, 7, 5118072, "フリーマーケット会場", 1, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 3);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (10118, "彼女たちの新たな日常", 20063115, 0, "オープニング", 0, 0, 0, 0, 5118600, 0, 0, 0, 0, 1);
